import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const About = () => {
  return (
    <div className="about-page py-5">
      <Container>
        <Row>
          <Col lg={8} className="mx-auto">
            <h1 className="text-center mb-5">About MK Hospital</h1>
            <div className="about-content">
              <p className="lead">
                MK Hospital is a leading healthcare institution committed to providing 
                exceptional medical care with compassion and expertise.
              </p>
              <p>
                Founded with a vision to make quality healthcare accessible to all, 
                we combine cutting-edge technology with experienced medical professionals 
                to deliver the best possible patient outcomes.
              </p>
              {/* Add more content as needed */}
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default About;
